import React from 'react';
import Navigation from '../components/Navigation';
const Home = () => {
    return (
        <div>
             <Navigation/>
            <h1 align="center">Archive de these et memoire de Madagascar </h1>
            <form>
            <label>
                Nom :
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Envoyer" />
            </form>
        </div>
    );
};

export default Home;
